import { useRef } from 'react'

const Test = () => {
    const text = useRef('This is Prev Text.');

    const handleUpdate = () => {
        text.current = 'This is Updated Text.';
        console.log(text.current);
    }

    return (
        <div>
            <button onClick={handleUpdate}>Update</button>
            <string>{text.current}</string>
            {console.log(text.current)}
        </div>
    )
}
